export default{
    methods:{
        userNameRegisterCheck() {
            if (this.userNameCheck(this.seller.name) != 'true') {
                this.nameErrorFlag = true;
                this.nameErrorMessage = this.userNameCheck(this.seller.name)
            } else {
                this.nameErrorFlag = false
                this.nameErrorMessage = ''
            }
        },
    }
}
